INSERT INTO `Reviews` VALUES (4,2,'i love this product, small and handy','2020-12-07 09:46:14',1,1),(5,4,'its okay, but not so good, bcz of its size, and requirment is bad too','2020-12-04 10:04:28',2,1),(6,3,'very thin and stylish product, good for study, but not for heavy work.','2020-12-04 10:04:28',3,1),(7,1,'i\'ve always wanted one of this, but, i dont like apple, thats the reason i dont buy one.','2020-12-07 09:46:14',1,2),(8,2,'i could use this for my gaming stuff, but dont wanna effort so much money for it','2020-12-07 09:46:14',2,2),(9,3,'too expensive for anything you could imagine, for this money you can make an station pc with good spec.','2020-12-07 09:46:14',3,2),(10,4,'its ok','2020-12-07 09:46:14',1,3),(11,1,'not bad, but you can buy somthing else with this price','2020-12-07 09:46:14',2,3),(12,4,'why not','2020-12-04 10:04:28',3,3),(13,3,'ipad is for those smart guys, bcz its handy','2020-12-04 10:04:28',4,4),(14,2,'not worth the money','2020-12-04 10:04:28',5,4),(15,4,'Jeg trækker altså snildt 36 timer ud af mit Watch Series 2. Det kommer alt sammen an på brugen og ja','2020-12-04 11:20:12',6,2),(16,5,NULL,'2020-12-04 10:04:28',4,5),(17,1,'Min lillebror har også en iPad Pro 12.9\" som han er utrolig glad for.\nJeg sad for en månedstid siden sammen med ham med min Air 2.\nOg spurgte ham hvad han helt præcis kunne med hans iPad som jeg ikke kunne med min.\nStørre og bedre skærm og 4 højttalere. Og så kunne han jo bruge Pencil og tastatur.\nOg det er da helt rigtig, men han har ikke købt hverken pencil eller tastaturet.\nOg trods den større skærm og de fine højttalere så er det stadigvæk de samme apps vi kan køre.\nJeg har enda multiview ligesom han har.\n\nSå når alt kom til alt var der med hans nuværende setup faktisk ikke noget han kunne som jeg ikke også kunne.\nHan kunne bare gøre det \"bedre\" hvis man kan sige det sådan :-)','2020-12-07 09:46:14',5,5),(18,2,NULL,'2020-12-07 09:46:14',6,5),(19,3,'Jeg vil næsten ønske jeg havde et formål med en iPad pro da jeg synes det er et super lækkert stykke hardware, min mor har en sidste generations Pro og den er kanon fed selvom jeg stadig synes iOS er et kedeligt og for låst styresystem til mig. Min finger svævede faktisk over \"køb\" da de blev sat til salg ;o)\n\nMen min telefon kan alt hvad en iPad kan så jeg ser bare ikke behovet for mig desværre udover den er nem at se serier med i sengen, på ferien etc hvis man vil have en større skærm. Og der er sgu lidt for meget jyde i mig til at smide så mange løg for at se Netflix på en større skærm :-)\n\nOg prisen er komisk høj ja. Ærgerligt Apple stadig bliver ved med at leve op til den fordom.','2020-12-07 09:46:14',4,6),(20,4,NULL,'2020-12-07 09:46:14',5,6),(21,1,'stylish and beautiful watch, for girls','2020-12-07 09:46:14',6,6),(22,2,'Mit nuværende smartwatch (Garmin Fenix 3 HR Saphire) holder strøm i ca. 14 dage, og jeg går med det 24/7 og bruger notifikationer og alt det der.\nJeg er helt klar over, at uret ikke er et smartwatch på samme måde som hhv. Samsung og Apple laver dem, men det absolut vigtigste for mig er, at det dels kan holde strøm i en længere periode og dels at det rent faktisk kan holde til at bruge brugt.\nJeg svømmer en del og kører også noget MTB, og tør ikke sætte min lid til, at Samsungs eller Apples ure er robuste nok.','2020-12-07 09:46:14',7,7),(23,3,NULL,'2020-12-04 10:04:28',8,7),(24,2,NULL,'2020-12-04 10:04:28',9,7),(25,3,'Nu har jeg selv et Fenix 3 og et Galaxy Watch (46mm). GW virker stort set ikke som fitness tracker. Det er designet til kun at tælle skridt hvis man går mindst 15 skridt uden pause. Så alle de små ture i hjemme eller på arbejde bliver ikke talt. Hvis man har en telefon i lommen med Samsung Health så får man en langt mere præcis måling.\n\nFenix 3 og alle andre fitness trackere har ikke dette problem.\n\nOg så er der pulsmåleren på GW. Som det tydeligvis fremgår på reddit, xda og Samsungs egne officielle fora så holder den KONSTANT op med at virke under træning. Ligegyldigt hvor stramt den sidder. Den kommer med en melding om at uret rykker sig og stopper målingen (bagefter kan man se noget mege lige horisontale linier i sin puls-graf). Samsung svarer ikke på problemet.\n\nOg så er der etage-tællingen. Den virker simpelthen ikke før man går MEGET højt op. Hvis jeg går op ad trappen hjemme eller på arbejde med Fenix 3 så tæller den etagen. GW gør det ikke - ligegyldigt hvor mange gange jeg går op.\n\nJeg ville ønske at I og andre anmeldere havde testet disse ting. Det er helt basalt. Tag en fitbit på sammen med et GW og så bliver det tydeligt at det ikke virker. Dog er der nogle på Youtube som er begyndt at gøre dette og det viser også at GW tæller alt for lidt skridt. Endda i forhold til forgængeren Gear S3.','2020-12-04 11:25:35',7,8),(26,5,NULL,'2020-12-04 10:04:28',8,8),(27,3,'This tv is making you forget about the content of movie, bcz. so real experincce you get from seeing it','2020-12-05 11:19:08',9,8),(28,3,NULL,'2020-12-07 09:46:14',7,9),(29,4,'4K-opløsning (3840 x 2160) er blevet standard, mens 8K gør sit indtog i high-end-klassen. Den moderne videostandard HDR (High Dynamic Range) er også blevet meget udbredt. De fleste nye film, serier og spil er nu tilgængelige i et eller andet HDR-format, men du har brug for et kompatibelt TV for at få det fulde udbytte af billedkvaliteten.','2020-12-07 09:46:14',8,9),(30,3,NULL,'2020-12-07 09:46:14',9,9),(31,1,'i need one of this, bcz ive tried it and worked very well with my needs','2020-12-07 09:46:14',11,5),(32,3,'Når man skifter TV, er det almindeligt at gå en skærmstørrelse op, mindst! 55-65 tommer har længe været blandt favoritterne – men nu begynder de virkelig store TV-skærme på 75-82 tommer eller mere også at fylde i salgsstatistikkerne. Og så længe man har kroner og kvadratmeter nok, er der ingen grund til at være konservativ: Et større TV giver som regel også en bedre og mere biografagtig seeroplevelse, som hele familien kan have glæde af.','2020-12-04 11:25:35',12,4),(33,4,NULL,'2020-12-04 10:04:28',13,3),(34,1,'not woth the money, too small but yea ok strong procesors','2020-12-07 09:46:14',11,2),(35,1,'Valget af TV involverer også at vælge panelteknologi. Efter nogle år på markedet havde mange nok forventet, at OLED ville dominere TV-udbuddet, men LCD lever stadig i bedste velgående.\n\nDet hænger sammen med størrelse og pris. OLED-TV’er giver en suveræn kontrastrig billedkvalitet, men priserne starter også relativt højt. Desuden ryger prisen på himmelfart, så snart man vil have noget over 65 tommer. Og det er der stadig flere, der vil …\n\nLCD’er har en mere fordelagtig pris pr. tomme, og de bedste LCD’er har også en billedkvalitet, der kan konkurrere med OLED-TV’erne – endda udkonkurrere dem i visse tilfælde.','2020-12-07 09:46:14',12,1),(36,4,NULL,'2020-12-04 10:04:28',13,3),(37,4,'Den kan mange ting som en PC kan, men kan den det lige så godt?? Hvis ikke man på sit job er lige så produktiv ved at vælge en iPad fremfor en laptop så kunne den koste 1kr og stadig være ligegyldig. Det er klart at man som journalist synes at \"det er jo en laptop!\" - men mange bruger en laptop til andet end blot at skrive på og vise slide shows. Hvis det eneste du laver privat er at surfe på nettet og webbank så erstatter den ikke en laptop - så skulle man ikke have købt en laptop i første omgang.\n\nDet er den fedeste tablet på markedet - by far. Men mere end det er den altså ikke.','2020-12-04 11:25:35',11,1),(38,4,NULL,'2020-12-07 09:46:14',12,2),(39,5,'the most advanced tv ever, with ninja function, that hach every server, og streaming','2020-12-05 11:13:52',13,4),(40,1,NULL,'2020-12-07 09:46:14',10,6),(41,5,NULL,'2020-12-04 10:04:28',10,8),(42,1,'this is not for adult use, kids could play game with it but nothing else.','2020-12-07 09:46:14',10,7),(43,5,NULL,'2020-12-04 10:04:28',14,3),(44,5,'not my type, im happier for my samsung s20, its not to compare','2020-12-05 11:20:35',15,8),(45,3,'i dont like it at all, too expensive, and some crazy feature, that i never would use','2020-12-05 11:13:52',13,7),(46,3,NULL,'2020-12-04 10:04:29',14,4),(47,1,'i like this product, but im waiting for the next model to get cheepper, then i can but it','2020-12-07 09:46:14',15,5),(48,1,NULL,'2020-12-07 09:46:14',13,6),(49,1,'the size is not optimal, i would perfer the 13 inch one, bcz its easy to transport and make you work distance.','2020-12-07 09:46:14',2,2),(50,2,NULL,'2020-12-07 09:46:14',4,3),(51,3,NULL,'2020-12-07 09:46:14',5,4),(52,3,'i have bought one of this, but my doughter dont like it, bcz of lacking in functionality','2020-12-07 09:46:14',7,5),(53,2,NULL,'2020-12-07 09:46:14',8,6);
